import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">

        <div>
          Cooper's Coolcast
        </div>
      </header>
      <body>
        <div>
          Coolcast Promos, Recommended things, upcoming events, etc.
        </div>
      </body>
    </div>
  );
}

export default App;
